y:\"Calibri\",sans-serif;\r\n	mso-ascii-font-family:Calibri;\r\n	mso-ascii-theme-font:minor-latin;\r\n	mso-hansi-font-family:Calibri;\r\n	mso-hansi-theme-font:minor-latin;\r\n	mso-bidi-font-family:\"Times New Roman\";\r\n	mso-bidi-theme-font:minor-bidi;\r\n	mso-fareast-language:EN-US;}\r\n</style>\r\n<![endif]--></p>\r\n<p class=\"MsoNormal\" style=\"line-height: 150%;\"><span lang=\"ES\">A este proceso solo tendr&aacute; acceso el personal de los departamentos de Comercial; <strong>Cuenca</strong>, <strong>Quito </strong>y <strong>Guayaquil</strong>. Incluido los asesores de Panam&aacute; para emitir la respuesta al cliente con los documentos solicitados en formato PDF.</span></p>\r\n<p>&nbsp;&nbsp; &nbsp; <strong>1.-</strong> AIngresamos al perfil de <strong>ENVIAR</strong>-&gt;<strong>Enviar ticket</strong> y escogemos <strong>Atenci&oacute;n al cliente</strong>.</p>\r\n<p style=\"text-align: justify;\"><a title=\"seleccion-proceso\" href=\"http://10.5.1.56/upload/1641313240_e7f926934223f1fbc4e6.png\" target=\"_blank\" rel=\"noopener\"><img class=\"img-fluid img-thumbnail\" src=\"http://10.5.1.56/upload/1641313240_e7f926934223f1fbc4e6.png\" alt=\"seleccion-proceso\" width=\"1400\" height=\"612\" /></a></p>\r\n<p style=\"text-align: justify;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<strong> 2.-</strong> Ingresamos la informaci&oacute;n del cliente que solicita el/los documento(s), adem&aacute;s el/los tipo(s) de documento(s). A modo de ejemplo, vamos a solicitar todos los documentos de una cuenta. Si el ejecutivo sabe el n&uacute;mero de cuenta, indicar en el campo de texto.</p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify; line-height: 150%;\"><strong><span lang=\"ES\">Informaci&oacute;n del Cliente: </span></strong></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify; line-height: 150%;\"><span lang=\"ES\">En esta secci&oacute;n debe escoger el tipo de Cliente, ya sea Persona Natural o Jur&iacute;dica, en el caso de una persona Jur&iacute;dica se agrega un nuevo destinatario (opcional)</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify; line-height: 150%;\"><strong><span lang=\"ES\">Informaci&oacute;n de los documentos a solicitar:</span></strong></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify; line-height: 150%;\"><span lang=\"ES\">Aqu&iacute; debe escoger los documentos a solicitar, ademas ingresar el n&uacute;mero de cuenta de acuerdo a los documentos a solicitar, los mismos que est&aacute;n separadados por secci&oacute;n.<br /></span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify; line-height: 150%;\"><a title=\"registro-solicitud-cliente\" href=\"http://10.5.1.56/upload/1641323457_a7d07e97401d9f96da67.png\" target=\"_blank\" rel=\"noopener\"><span lang=\"ES\"><img class=\"img-fluid img-thumbnail\" src=\"http://10.5.1.56/upload/1641323457_a7d07e97401d9f96da67.png\" alt=\"\" width=\"1920\" height=\"2806\" /></span></a></p>\r\n<p><!-- [if gte mso 9]><xml>\r\n <o:OfficeDocumentSettings>\r\n  <o:RelyOnVML/>\r\n  <o:AllowPNG/>\r\n </o:OfficeDocumentSettings>\r\n</xml><![endif]--><!-- [if gte mso 9]><xml>\r\n <w:WordDocument>\r\n  <w:View>Normal</w:View>\r\n  <w:Zoom>0</w:Zoom>\r\n  <w:TrackMoves/>\r\n  <w:TrackFormatting/>\r\n  <w:HyphenationZone>21</w:HyphenationZone>\r\n  <w:PunctuationKerning/>\r\n  <w:ValidateAgainstSchemas/>\r\n  <w:SaveIfXMLInvalid>false</w:SaveIfXMLInvalid>\r\n  <w:IgnoreMixedContent>false</w:IgnoreMixedContent>\r\n  <w:AlwaysShowPlaceholderText>false</w:AlwaysShowPlaceholderText>\r\n  <w:DoNotPromoteQF/>\r\n  <w:LidThemeOther>ES-EC</w:LidThemeOther>\r\n  <w:LidThemeAsian>X-NONE</w:LidThemeAsian>\r\n  <w:LidThemeComplexScript>X-NONE</w:LidThemeComplexScript>\r\n  <w:Compatibility>\r\n   <w:BreakWrappedTables/>\r\n   <w:SnapToGridInCell/>\r\n   <w:WrapTextWithPunct/>\r\n   <w:UseAsianBreakRules/>\r\n   <w:DontGrowAutofit/>\r\n   <w:SplitPgBreakAndParaMark/>\r\n   <w:EnableOpenTypeKerning/>\r\n   <w:DontFlipMirrorIndents/>\r\n   <w:OverrideTableStyleHps/>\r\n  </w:Compatibility>\r\n  <m:mathPr>\r\n   <m:mathFont m:val=\"Cambria Math\"/>\r\n   <m:brkBin m:val=\"before\"/>\r\n   <m:brkBinSub m:val=\"--\"/>\r\n   <m:smallFrac m:val=\"off\"/>\r\n   <m:dispDef/>\r\n   <m:lMargin m:val=\"0\"/>\r\n   <m:rMargin m:val=\"0\"/>\r\n   <m:defJc m:val=\"centerGroup\"/>\r\n   <m:wrapIndent m:val=\"1440\"/>\r\n   <m:intLim m:val=\"subSup\"/>\r\n   <m:naryLim m:val=\"undOvr\"/>\r\n  </m:mathPr></w:WordDocument>\r\n</xml><![endif]--></p>\r\n<p class=\"MsoNormal\" style=\"line-height: 150%; text-align: justify;\"><strong><span lang=\"ES\" style=\"font-size: 12.0pt; line-height: 150%;\">Importante</span></strong></p>\r\n<p class=\"MsoNormal\" style=\"line-height: 150%; text-align: justify;\"><span lang=\"ES\">Las validaciones a tener en cuenta al momento de llenar la informaci&oacute;n del Cliente:</span></p>\r\n<p class=\"MsoNormal\" style=\"line-height: 150%; text-align: justify;\"><strong><span lang=\"ES\">Nombre cliente:</span></strong><span lang=\"ES\"> caracteres alfab&eacute;ticos adem&aacute;s de caracteres especiales como (. - &amp;).</span></p>\r\n<p class=\"MsoNormal\" style=\"line-height: 150%; text-align: justify;\"><strong><span lang=\"ES\">Nombres de los destinos:</span></strong><span lang=\"ES\"> solo caracteres alfab&eacute;ticos.</span></p>\r\n<p class=\"MsoNormal\" style=\"line-height: 150%; text-align: justify;\"><strong><span lang=\"ES\">N&uacute;mero de identificaci&oacute;n:</span></strong><span lang=\"ES\"> permite caracteres alfanum&eacute;ricos incluyendo el guion medio (-).</span></p>\r\n<p class=\"MsoNormal\" style=\"line-height: 150%; text-align: justify;\"><strong><span lang=\"ES\">Correo electr&oacute;nico:</span></strong><span lang=\"ES\"> debe tener el formato valido de una direcci&oacute;n de correo electr&oacute;nico, por ejemplo <a href=\"mailto:ejemplo@gmail.com\">ejemplo@gmail.com</a>. As&iacute; mismo este correo no puede ser el mismo el del ejecutivo que est&aacute; solicitando la informaci&oacute;n del cliente.</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify; line-height: 150%;\"><span lang=\"ES\">Una vez llenada la informaci&oacute;n del cliente y los documentos a solicitar damos a <strong>ENVIAR</strong>. As&iacute; mismo tanto el ejecutivo como el asesor deben de tener la notificaci&oacute;n del email con los datos del nuevo ticket.</span></p>\r\n<p class=\"MsoNormal\" style=\"text-align: justify; line-height: 150%;\"><span lang=\"ES\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <strong>3.-</strong> Vista de la solicitud de los documentos desde el perfil del Asesor de Panam&aacute;. Aqu&iacute; se muestra la informaci&oacute;n que solicita el cliente a trav&eacute;s del ejecutivo de Ecuador.</span></p>\r\n<p class=\"MsoNormal\" style=\"line-height: 150%; text-align: center;\"><a title=\"solicitud-vista-asesor\" href=\"http://10.5.1.56/upload/1641324264_640dd9cce9371a1ff6db.png\" target=\"_blank\" rel=\"noopener\"><span lang=\"ES\"><img class=\"img-fluid img-thumbnail\" src=\"http://10.5.1.56/upload/1641324264_640dd9cce9371a1ff6db.png\" alt=\"vista-asesor\" width=\"1920\" height=\"904\" /></span></a></p>\r\n<p class=\"MsoNormal\" style=\"line-height: 150%; text-align: justify;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<strong> 4.-</strong> Respuesta del Asesor de Panam&aacute; con los documentos solicitados. Al dar Click en el bot&oacute;n &ldquo;Responder&rdquo; se carga el resumen de los documentos solicitados y el formulario para adjuntar los archivos en formato PDF.</p>\r\n<p class=\"MsoNormal\" style=\"line-height: 150%; text-align: justify;\">&nbsp;</p>\r\n<p class=\"MsoNormal\" style=\"margin-left: 18.0pt; text-align: justify; line-height: 150%;\"><span lang=\"ES\">Tambi&eacute;n se tiene la opci&oacute;n de modificar el correo electr&oacute;nico del Cliente. Para el ejemplo voy a cambiar la direcci&oacute;n de correo electr&oacute;nico a <a href=\"mailto:soporte20@gmail.com\">soporte20@gmail.com</a> para poder visualizar la respuesta que recibir&aacute; el cliente. </span></p>\r\n<p class=\"MsoNormal\" style=\"margin-left: 18.0pt; text-align: justify; line-height: 150%;\"><span lang=\"ES\">Y para finalizar la respuesta al cliente con la informaci&oacute;n solicitada, debe dar a <strong>ENVIAR</strong>. A continuaci&oacute;n, se muestra el resumen de la informaci&oacute;n que llena el Asesor de Panam&aacute;.</span></p>\r\n<p class=\"MsoNormal\" style=\"margin-left: 18.0pt; text-align: justify; line-height: 150%;\"><strong><span lang=\"ES\">Nota:</span></strong><span lang=\"ES\"> <span style=\"background: yellow; mso-highlight: yellow;\">una vez que el asesor emite la respuesta el ticket se cierra autom&aacute;ticamente.</span></span></p>\r\n<p class=\"MsoNormal\" style=\"margin-left: 18pt; line-height: 150%; text-align: center;\"><a title=\"respuesta-ticket\" href=\"http://10.5.1.56/upload/1641324597_f82019b63ed8c0b1ef78.png\" target=\"_blank\" rel=\"noopener\"><span lang=\"ES\"><span style=\"background: yellow; mso-highlight: yellow;\"><img class=\"img-fluid img-thumbnail\" src=\"http://10.5.1.56/upload/1641324597_f82019b63ed8c0b1ef78.png\" alt=\"respuesta-ticket\" width=\"1920\" height=\"911\" /></span></span></a></p>\r\n<p class=\"MsoNormal\" style=\"line-height: 150%; text-align: justify;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<strong> 5.-</strong> Respuesta al Ejecutivo, aqu&iacute; el ejecutivo solo podr&aacute; visualizar los documentos que fueron enviados al cliente, esto desde su perfil en la herramienta HELPDESK.</p>\r\n<p class=\"MsoNormal\" style=\"line-height: 150%; text-align: center;\"><a title=\"vista-ejecutivo-respuesta-ticket\" href=\"http://10.5.1.56/upload/1641325462_ac7f6879f17d7225125e.png\" target=\"_blank\" rel=\"noopener\"><img class=\"img-fluid img-thumbnail\" src=\"http://10.5.1.56/upload/1641325462_ac7f6879f17d7225125e.png\" alt=\"vista-ejecutivo-respuesta-ticket\" width=\"1920\" height=\"3426\" /></a></p>\r\n<p class=\"MsoNormal\" style=\"line-height: 150%; text-align: justify;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <strong>6.-</strong> Y por &uacute;ltimo a modo ejemplo se expone la visualizaci&oacute;n de un documento PDF, esto desde el perfil del Ejecutivo. Tambi&eacute;n dispone de las opciones de hacer zoom y paginar.</p>\r\n<p class=\"MsoNormal\" style=\"line-height: 150%; text-align: center;\"><a title=\"vista-pdf_ejecutivo\" href=\"http://10.5.1.56/upload/1641325686_5a68e0afe1bc557209ed.png\" target=\"_blank\" rel=\"noopener\"><img class=\"img-fluid img-thumbnail\" src=\"http://10.5.1.56/upload/1641325686_5a68e0afe1bc557209ed.png\" alt=\"vista-pdf_ejecutivo\" width=\"1920\" height=\"909\" /></a><!-- [if gte mso 9]><xml>\r\n <o:OfficeDocumentSettings>\r\n  <o:RelyOnVML/>\r\n  <o:AllowPNG/>\r\n </o:OfficeDocumentSettings>\r\n</xml><![endif]--><!-- [if gte mso 9]><xml>\r\n <w:WordDocument>\r\n  <w:View>Normal</w:View>\r\n  <w:Zoom>0</w:Zoom>\r\n  <w:TrackMoves/>\r\n  <w:TrackFormatting/>\r\n  <w:HyphenationZone>21</w:HyphenationZone>\r\n  <w:PunctuationKerning/>\r\n  <w:ValidateAgainstSchemas/>\r\n  <w:SaveIfXMLInvalid>false</w:SaveIfXMLInvalid>\r\n  <w:IgnoreMixedContent>false</w:IgnoreMixedContent>\r\n  <w:AlwaysShowPlaceholderText>false</w:AlwaysShowPlaceholderText>\r\n  <w:DoNotPromoteQF/>\r\n  <w:LidThemeOther>ES-EC</w:LidThemeOther>\r\n  <w:LidThemeAsian>X-NONE</w:LidThemeAsian>\r\n  <w:LidThemeComplexScript>X-NONE</w:LidThemeComplexScript>\r\n  <w:Compatibility>\r\n   <w:BreakWrappedTables/>\r\n   <w:SnapToGridInCell/>\r\n   <w:WrapTextWithPunct/>\r\n   <w:UseAsianBreakRules/>\r\n   <w:DontGrowAutofit/>\r\n   <w:SplitPgBreakAndParaMark/>\r\n   <w:EnableOpenTypeKerning/>\r\n   <w:DontFlipMirrorIndents/>\r\n   <w:OverrideTableStyleHps/>\r\n  </w:Compatibility>\r\n  <m:mathPr>\r\n   <m:mathFont m:val=\"Cambria Math\"/>\r\n   <m:brkBin m:val=\"before\"/>\r\n   <m:brkBinSub m:val=\"--\"/>\r\n   <m:smallFrac m:val=\"off\"/>\r\n   <m:dispDef/>\r\n   <m:lMargin m:val=\"0\"/>\r\n   <m:rMargin m:val=\"0\"/>\r\n   <m:defJc m:val=\"centerGroup\"/>\r\n   <m:wrapI