INSERT INTO `hdz_emails_tpl` VALUES ('autoresponse',4,'New Message Autoresponse','[#%ticket_id%] %ticket_subject%','<p>Dear %client_name%,</p>\r\n<p>Your reply to support request #%ticket_id% has been noted.</p>\r\n<p>Ticket Details <br />--------------------<br />Ticket ID: %ticket_id% <br />Department: %ticket_department% <br />Status: %ticket_status% <br />Priority: %ticket_priority% <br />Helpdesk: %support_url%</p>',0,1),('client_notification',7,'New notification to client','Re: [#%ticket_id%] %ticket_subject%','<!DOCTYPE html>\n<html lang=\"en\">\n\n<head>\n    <meta http-equiv=\"Content-Type\" content=\"text/html; charset=utf-8\" />\n    <meta name=\"viewport\" content=\"width=device-width, initial-scale=1\">\n    <meta http-equiv=\"X-UA-Compatible\" content=\"IE=edge\" />\n    <title>Document</title>\n\n    <style type=\"text/css\">\n        @media screen {\n            @font-face {\n                font-family: `Lato`;\n                font-style: normal;\n                font-weight: 400;\n                src: local(`Lato Regular`), local(`Lato-Regular`), url(https://fonts.gstatic.com/s/lato/v11/qIIYRU-oROkIk8vfvxw6QvesZW2xOQ-xsNqO47m55DA.woff) format(`woff`);\n            }\n            @font-face {\n                font-family: `Lato`;\n                font-style: normal;\n                font-weight: 700;\n                src: local(`Lato Bold`), local(`Lato-Bold`), url(https://fonts.gstatic.com/s/lato/v11/qdgUG4U09HnJwhYI-uK18wLUuEpTyoUstqEm5AMlJo4.woff) format(`woff`);\n            }\n            @font-face {\n                font-family: `Lato`;\n                font-style: italic;\n                font-weight: 400;\n                src: local(`Lato Italic`), local(`Lato-Italic`), url(https://fonts.gstatic.com/s/lato/v11/RYyZNoeFgb0l7W3Vu1aSWOvvDin1pK8aKteLpeZ5c0A.woff) format(`woff`);\n            }\n            @font-face {\n                font-family: `Lato`;\n                font-style: italic;\n                font-weight: 700;\n               